class PlayerList extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            players: [
                "Miljan",
                "Jovan",
                "Stefan",
                "Mali Peder",
                "Sovljanski",
                "Bogdan",
                "Gomboca",
                "Markov",
                "Ivan",
                "Slaven"
            ]
        };
    }
    getPlayers() {
        return (
            <div className="list-group">
                {
                    this.state.players.forEach((player, index) => {
                        return <a key={index} className="list-group-item list-group-item-action">
                            {player}
                        </a>
                    })
                }
            </div>
        )
    }

    render() {
        return (
            <div className="d-flex justify-content-center">
                test
                {this.getPlayers()}
            </div>
        )
    }
}
export default PlayerList;
